import React from "react";

import dummySool from "../static/dummyData";
import SoolCard from "./SoolCard";

const SoolList = () => {
    return (
        <>
            <div>SoolList</div>
            <ul>
                {dummySool.map((sool) => <SoolCard key={sool.id} sool={sool}/>)}
            </ul>
        </>
    )
}

export default SoolList
